(function(){Application.controller("ProfileController",["$scope","$http",function(n,t){n.Manuals=[];n.User={};n.TopDiscManuals={};n.TopRatManuals={};n.GetManuals=function(){return t({method:"POST",url:"/User/GetManualsByUserId",data:{Id:n.Id}}).success(function(t){n.Manuals=t})};n.GeMostDisc=function(){return t({method:"POST",url:"/Home/GetMostDiscussedManual",data:{UserId:n.Id}}).success(function(t){n.TopDiscManuals=t})};n.GetTop=function(){return t({method:"POST",url:"/Home/GetTopManual",data:{UserId:n.Id}}).success(function(t){n.TopRatManuals=t})};n.ChangeRating=function(n,i){t({method:"POST",url:"/Home/ChangeRating",data:{manual:n,liked:i}}).success(function(t){n.Rating=t.newRating})};n.DeleteManual=function(i){t({method:"POST",url:"/Home/DeleteManual",data:{manual:i}}).success(function(){return n.Manuals.splice(n.Manuals.indexOf(i),1)})};return}])}).call(this);